contracts/Admin.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

contract Admin {
    enum UserRole {
        NOROLE,
        SELLER,
        TRANSPORTER,
        CUSTOMER,
        REVOKE
    }
    struct UserData {
        address ethAddress;
        string name;
        string location;
        UserRole role;
    }

    mapping(address => UserData) private userDetail;

    event RegisterUser(address indexed ethAddress, string name);
    event ReassignRole(address indexed ethAddress, uint8 role);
    event RevokeRole(address indexed ethAddress, uint8 role);
    event UpdateLocation(address indexed ethAddress, string role);

    modifier isUser() {
        require(
            userDetail[msg.sender].ethAddress == msg.sender,
            "Invalid Address Found"
        );
        _;
    }

    // Register User
    function registerUser(
        string memory name,
        string memory location,
        uint256 role
    ) external {
        require(
            userDetail[msg.sender].ethAddress == address(0),
            "User already exixsting with this eth address"
        );

        userDetail[msg.sender] = UserData(
            msg.sender,
            name,
            location,
            UserRole(role)
        );
        emit RegisterUser(msg.sender, name);
    }

    // Revoke Role
    function revokeRole() external isUser {
        userDetail[msg.sender].role = UserRole.REVOKE;
        emit RevokeRole(msg.sender, uint8(userDetail[msg.sender].role));
    }

    // Reassign Role
    function assignRole(uint8 role) external isUser {
        userDetail[msg.sender].role = UserRole(role);
        emit ReassignRole(msg.sender, uint8(userDetail[msg.sender].role));
    }

    // Change Location
    function updateLocation(string memory location) external isUser {
        userDetail[msg.sender].location = location;
        emit UpdateLocation(msg.sender, userDetail[msg.sender].location);
    }

    // User Data
    function getUser() external view returns (UserData memory) {
        return userDetail[msg.sender];
    }

    // User Role
    function getRole(address ethAddress) external view returns (uint8) {
        return uint8(userDetail[ethAddress].role);
    }
}

contracts/Customer.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "./Admin.sol";
import "./Order.sol";
import "./Seller.sol";
import "./Transporter.sol";

contract Customer {
    enum UserRole {
        NOROLE,
        SELLER,
        TRANSPORTER,
        CUSTOMER,
        REVOKE
    }
    Admin private admin;
    Seller private seller;
    Transporter private transporter;
    mapping(address => address[]) public orders;

    constructor(
        Admin adminAddress,
        Seller sellerAddress,
        Transporter transporterAddress
    ) {
        admin = adminAddress;
        seller = sellerAddress;
        transporter = transporterAddress;
    }

    modifier onlyCustomer() {
        require(
            UserRole(admin.getRole(msg.sender)) == UserRole.CUSTOMER,
            "Only customer has access"
        );
        _;
    }

    // Place Order
    function placeOrder(
        uint256 orderId,
        address seller_ethAddress,
        address transporter_ethAddress,
        string memory location,
        uint8 quantity,
        string memory items
    ) external payable onlyCustomer {
        require(
            UserRole(admin.getRole(seller_ethAddress)) == UserRole.SELLER,
            "Invalid seller address"
        );
        require(
            UserRole(admin.getRole(transporter_ethAddress)) ==
                UserRole.TRANSPORTER,
            "Invalid transporter address"
        );
        require(msg.value > 0, "You have to pay");

        Order newOrder = new Order{value: msg.value}(
            admin,
            orderId,
            msg.sender,
            seller_ethAddress,
            transporter_ethAddress,
            location,
            quantity,
            items,
            msg.value
        );
        orders[msg.sender].push(address(newOrder));
        seller.setNewOrder(seller_ethAddress, address(newOrder));
        transporter.setNewOrder(transporter_ethAddress, address(newOrder));
    }

    // Cancel Order
    function cancelOrder(uint256 index) external onlyCustomer {
        Order(orders[msg.sender][index]).cancelOrder(msg.sender);
    }

    // Get All Order
    function getAllOrders() external view returns (address[] memory) {
        return orders[msg.sender];
    }

    // Get Order By Index
    function getOrderByIndex(uint256 index) external view returns (address) {
        return orders[msg.sender][index];
    }

    // Get Order Details
    function getOrderDetail(
        address orderAddress
    )
        external
        view
        returns (
            uint256 _orderId,
            address _seller_ethAddress,
            address _transporter_ethAddress,
            string memory _location,
            string memory _items,
            uint256 _quantity,
            uint256 _amount,
            Order.OrderStatus _status
        )
    {
        return Order(orderAddress).getOrderDetail(msg.sender);
    }
}

contracts/Order.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "./Admin.sol";

contract Order {
    enum UserRole {
        NOROLE,
        SELLER,
        TRANSPORTER,
        CUSTOMER,
        REVOKE
    }
    enum OrderStatus {
        PLACED,
        CONFIRM,
        PACKAGING,
        SHIPPED,
        OUT_FOR_DELIVERY,
        DELIVERED,
        CANCEL
    }
    Admin private admin;
    uint256 public orderId;
    address public customer_ethAddress;
    address public seller_ethAddress;
    address public transporter_ethAddress;
    string public location;
    uint8 public quantity;
    string public items;
    uint public amount;
    OrderStatus public status;

    constructor(
        Admin adminAddress,
        uint256 _orderId,
        address _customer_ethAddress,
        address _seller_ethAddress,
        address _transporter_ethAddress,
        string memory _location,
        uint8 _quantity,
        string memory _items,
        uint _amount
    ) payable {
        admin = adminAddress;
        orderId = _orderId;
        customer_ethAddress = _customer_ethAddress;
        seller_ethAddress = _seller_ethAddress;
        transporter_ethAddress = _transporter_ethAddress;
        location = _location;
        quantity = _quantity;
        items = _items;
        amount = _amount;
        status = OrderStatus.PLACED;
    }

    modifier onlySeller(address ethAddress) {
        require(
            UserRole(admin.getRole(ethAddress)) == UserRole.SELLER,
            "Only seller has access"
        );
        require(
            seller_ethAddress == ethAddress,
            "Invalid seller address for this order"
        );
        _;
    }

    modifier onlyTransporter(address ethAddress) {
        require(
            UserRole(admin.getRole(ethAddress)) == UserRole.TRANSPORTER,
            "Only transporter has access"
        );
        require(
            transporter_ethAddress == ethAddress,
            "Invalid transporter address for this order"
        );
        _;
    }

    modifier onlyCustomer(address ethAddress) {
        require(
            UserRole(admin.getRole(ethAddress)) == UserRole.CUSTOMER,
            "Only customer has access"
        );
        require(
            customer_ethAddress == ethAddress,
            "Invalid customer address for this order"
        );
        _;
    }

    // Confirm Order
    function confirmOrder(address ethAddress) external onlySeller(ethAddress) {
        require(status == OrderStatus.PLACED, "Order is not in placed state");

        status = OrderStatus.CONFIRM;
    }

    // Packaging Order
    function packagingOrder(
        address ethAddress
    ) external onlySeller(ethAddress) {
        require(status == OrderStatus.CONFIRM, "Order is not in confirm state");

        status = OrderStatus.PACKAGING;
    }

    // Shipped Order
    function shippingOrder(
        address ethAddress
    ) external onlyTransporter(ethAddress) {
        require(
            status == OrderStatus.PACKAGING,
            "Order is not in packaging state"
        );

        status = OrderStatus.SHIPPED;
    }

    // Out For Delivery Order
    function outForDeliveryOrder(
        address ethAddress
    ) external onlyTransporter(ethAddress) {
        require(status == OrderStatus.SHIPPED, "Order is not in shipped state");

        status = OrderStatus.OUT_FOR_DELIVERY;
    }

    // Deliverd Order
    function deliverdOrder(
        address ethAddress
    ) external payable onlyTransporter(ethAddress) {
        require(
            status == OrderStatus.OUT_FOR_DELIVERY,
            "Order is not in out for delivery state"
        );

        payable(seller_ethAddress).transfer(amount);
        status = OrderStatus.DELIVERED;
    }

    // Cancel Order
    function cancelOrder(address ethAddress) external onlyCustomer(ethAddress) {
        require(
            status == OrderStatus.PLACED ||
                status == OrderStatus.CONFIRM ||
                status == OrderStatus.PACKAGING ||
                status == OrderStatus.SHIPPED,
            "Order cannot be cancel"
        );

        payable(customer_ethAddress).transfer(amount);
        status = OrderStatus.CANCEL;
    }

    // Get Order Details
    function getOrderDetail(
        address ethAddress
    )
        external
        view
        onlyCustomer(ethAddress)
        returns (
            uint _orderId,
            address _seller_ethAddress,
            address _transporter_ethAddress,
            string memory _location,
            string memory _items,
            uint _quantity,
            uint _amount,
            OrderStatus _status
        )
    {
        return (
            orderId,
            seller_ethAddress,
            transporter_ethAddress,
            location,
            items,
            quantity,
            amount,
            status
        );
    }
}

contracts/Seller.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "./Admin.sol";
import "./Order.sol";

contract Seller {
    Admin private admin;
    Order private order;
    enum UserRole {
        NOROLE,
        SELLER,
        TRANSPORTER,
        CUSTOMER,
        REVOKE
    }

    mapping(address => address[]) public orders;

    constructor(Admin adminAddress) {
        admin = adminAddress;
    }

    modifier onlySeller() {
        require(
            UserRole(admin.getRole(msg.sender)) == UserRole.SELLER,
            "Only seller has access"
        );
        _;
    }

    modifier validOrder(Order orderAddress) {
        require(
            orderAddress.seller_ethAddress() == msg.sender,
            "Invalid seller address for this order"
        );
        _;
    }

    // Set Order
    function setNewOrder(
        address seller_ethAddress,
        address orderAddress
    ) external {
        orders[seller_ethAddress].push(orderAddress);
    }

    // Confirm Order
    function confirmOrder(
        Order orderAddress
    ) external onlySeller validOrder(orderAddress) {
        Order(orderAddress).confirmOrder(msg.sender);
    }

    // Packaging Order
    function packagingOrder(
        Order orderAddress
    ) external onlySeller validOrder(orderAddress) {
        Order(orderAddress).packagingOrder(msg.sender);
    }

    // Get Order By Index
    function getOrderByIndex(uint256 index) external view returns (address) {
        return orders[msg.sender][index];
    }

    // Get All Orders
    function getAllOrders() external view returns (address[] memory) {
        return orders[msg.sender];
    }
}

